-b-PHP CLASS xml2db-/b-

Třída pro převod z XML do DB

-c-<?php

class xml2db
{
	var $db;					// odkaz na ez_sql object  [object]
	var $priv_parser;	// odkaz na parser  [object]

	var $cur_tag;			// prave zpracovavany tag/element  -  odpovida sloupci tabulky  [string]
	var $cur_parent;	// prave zpracovavany rodicovsky tag/element  -  odpovida tabulce  [string]
	var $values;      // obsah prave zpracovavaneho $cur_parent  [array]

	var $parents;     // vsechny (platne) rodicovske tagy/elementy  -  tabulky  [array]

	var $errors;			// pro ukladani pripadnych chybovych hlaseni pri insertu  [array]


	function __construct($db_obj, $all_parents)
	{
		if(empty($db_obj) || !method_exists($db_obj, "query"))
			echo "[line ".__LINE__."] error: neplatný ukazetel na object pro práci s DB (not ez_sql object)";

		if(empty($all_parents) || !is_array($all_parents))
			echo "[line ".__LINE__."] error: neplatný seznam odpovídajících mateřských elementů/tabulek  (not array)";

		$this->db = $db_obj;
		$this->parents = $all_parents;
	}

	protected function start_element($parser, $tag, $attr)
	{
		$this->cur_tag = $tag;

		if($this->is_cur_parent($tag))
		{
			$this->values = "";
			$this->cur_parent = $tag;
		}
	}

	protected function end_element($parser, $tag)
	{
		$accent = false;

		if($this->is_cur_parent($tag))
		{
			// nastaveni sloupcu a jejich hodnot
			foreach($this->values as $key => $value)
			{
				if($accent && !empty($key))
					$q_columns .= ", ";
				$q_columns .= $key;

				if($accent && !empty($key))
					$q_values .= ", ";
				if(!empty($key))
					$q_values .= "'".addSlashes($value)."'";

				$accent = true;
			}
			// sestaveni insert dotazu
			$query = "INSERT INTO `".$this->cur_parent."`";
			$query .= " (";
			$query .= $q_columns;
			$query .= ")";
			$query .= " VALUES";
			$query .=" (";
			$query .= $q_values;
			$query .= ")";

			$this->db->query($query); 
			if(mysql_error())
				$this->errors[] = "neúspěšný insert: ".
				                  "#".mysql_errno()."-".mysql_error().
				                  " in query: ".$query;
		}

		$this->cur_tag = "";
	}

	protected function element_data($parser, $data)
	{
		if(!$this->is_cur_parent($this->cur_tag))
			$this->values[$this->cur_tag] .= $data;
	}

	public function is_cur_parent ($actual_parent)
	{
		foreach($this->parents as $parent)
			if($parent == $actual_parent) return true;

		return false;
	}

	public function get_errors ()
	{
		if(!empty($this->errors))
			return $this->errors;
		else
			return false;
	}

	public function parse_file ($file)
	{
		if(!file_exists($file))
			echo "[line ".__LINE__."] error: soubor neexistuje";

		if(!($f = fopen($file, "r")))
			echo "[line ".__LINE__."] error: soubor nelze otevřít";

		if(!($xml_data = fread($f, filesize($file))))
			echo "[line ".__LINE__."] error: soubor nelze načíst";

		$this->parse_string($xml_data);
	}

	public function parse_string ($xml_data)
	{
		// vytvoreni parseru, nasteveni $this->$this->priv_parser na $this->priv_parser
		$this->priv_parser = xml_parser_create();
		xml_set_object($this->priv_parser, $this); 

		// nastaveni parseru
		xml_parser_set_option($this->priv_parser, XML_OPTION_CASE_FOLDING, 0);
		xml_parser_set_option($this->priv_parser, XML_OPTION_SKIP_WHITE,   1);
		#xml_parser_set_option($this->priv_parser, XML_OPTION_TARGET_ENCODING, "UTF-8");

		xml_set_element_handler($this->priv_parser, "start_element", "end_element");
		xml_set_character_data_handler($this->priv_parser, "element_data");

		// osetreni vsupniho xml formatu (pro "bezpecnejsi" parsovani)
		$xml_data = ereg_replace("(\n)+", "", $xml_data);   //nahradi '\n' za ''
		$xml_data = ereg_replace("(\t)+", "", $xml_data);   //nahradi '\t' za ''
		#$xml_data = str_replace(" ", "", $xml_data);   //nahradi ' ' za ''

		// parsovani
		if(!xml_parse($this->priv_parser, $xml_data))
			echo "[line ".__LINE__."] error: XML dokument nelze zpracovat: ".
			     "#".xml_get_error_code($this->priv_parser).
			     "-".xml_error_string(xml_get_error_code($this->priv_parser)).
			     " on line ".xml_get_current_line_number($this->priv_parser).
			     " in column ".xml_get_current_column_number($this->priv_parser);

		xml_parser_free($this->priv_parser);
	}
} //end of class

?>-/c-

-b-PHP CLASS format_text-/b-

Třída ošetří text (externě vložený) pro zobrazení na HTML stránce a případně dále zpracuje "řídící instrukce".

-c-<?php

class format_text
{
	var $filter;			//pole s maskami a nahradami
	var $html_status;		//nastaveni prevodu html do textu on/off
	var $filter_status;	//nastaveni filtru on/off
	var $create_links;	//automaticky prevadet URL adresy na odkzy
	var $text;				//vlastni text

	function format_text ($ocistit = true, $filtrovat = true)
	{
		$this->html_status   = $ocistit;
		$this->filter_status = $filtrovat;
	}

	function _create_links ()
	{
		//eregi("[h|f]t?tp://[a-z0-9_\.\-]+[a-z0-9_/\+\.\-]+", $this->text, $urls);
		/*eregi("((http://|ftp://)[a-zA-Z0-9-_]*.[a-zA-Z0-9-_.]*(/|?[^ rtn]*)?)", $this->text, $urls);// var_dump($urls);
		if(!empty($urls))
		foreach($urls as $url)
			$this->text = ereg_replace($url, "<a href=\"$url\">".$url."</a>", $this->text);*/

		$this->text = ereg_replace('[[:alpha:]]+://[^<>[:space:]]+[[:alnum:]/]', '<a href="\0" title="odkaz se otevře v novém okně!" target="_blank">\0</a>', $this->text);
	}

	function _filter ()
	{
		$i = 1;   //zacatek zvyrazneni
		$this->filter['maska']  [$i] = "-b-";
		$this->filter['nahrada'][$i] = "<strong>";

		$i++;     //konec zvyrazneni
		$this->filter['maska']  [$i] = "-/b-";
		$this->filter['nahrada'][$i] = "</strong>";

		$i++;     //zacatek kodu
		$this->filter['maska']  [$i] = "-c-";
		$this->filter['nahrada'][$i] = "<code>";

		$i++;     //konec kodu
		$this->filter['maska']  [$i] = "-/c-";
		$this->filter['nahrada'][$i] = "</code>";

		$i++;     //konec odkazu (uzaviraci tag elementu a)
		$this->filter['maska']  [$i] = "-e-";
		$this->filter['nahrada'][$i] = "<em>";

		$i++;     //konec odkazu (uzaviraci tag elementu a)
		$this->filter['maska']  [$i] = "-/e-";
		$this->filter['nahrada'][$i] = "</em>";

		//pokud se maji URL adresy auto. prevest, neni treba pouzivat spec. znaku
		if($this->create_links)
		{
			$i++;     //zacatek odkazu (zacatek prvni tagu elementu a)
			$this->filter['maska']  [$i] = "-l-";
			$this->filter['nahrada'][$i] = "";

			$i++;     //konec atributu href odkazu (konec prvniho tagu elementu a)
			$this->filter['maska']  [$i] = "-el-";
			$this->filter['nahrada'][$i] = " - ";

			$i++;     //konec odkazu (uzaviraci tag elementu a)
			$this->filter['maska']  [$i] = "-/l-";
			$this->filter['nahrada'][$i] = "";
		} else
		{
			$i++;     //zacatek odkazu (zacatek prvni tagu elementu a)
			$this->filter['maska']  [$i] = "-l-";
			$this->filter['nahrada'][$i] = "<a href=\"";

			$i++;     //konec atributu href odkazu (konec prvniho tagu elementu a)
			$this->filter['maska']  [$i] = "-el-";
			$this->filter['nahrada'][$i] = "\" title=\"odkaz se otevře v novém okně!\" target=\"_blank\">";

			$i++;     //konec odkazu (uzaviraci tag elementu a)
			$this->filter['maska']  [$i] = "-/l-";
			$this->filter['nahrada'][$i] = "</a>";
		}


		# nahradi retezec 'x' za retezec 'y'
		for($j=1; $j<=count($this->filter['maska']); $j++)
			$this->text = str_replace($this->filter['maska'][$j], $this->filter['nahrada'][$j], $this->text);
	}

	function _wiev_format ()
	{
		$this->text = trim($this->text);                               //orezani mezer na konci a na zacatku textu
		$this->text = HTMLSpecialChars($this->text);                   //prevede HTML tagy do HTML entit
		$this->text = Ereg_Replace("  ", "&nbsp;&nbsp;", $this->text); //nahradi 2 mezeri HTML entitami pro mezery
		$this->text = Ereg_Replace("\t", "&nbsp;&nbsp;", $this->text); //nahradi \t HTML entitami pro mezery
		$this->text = nl2br($this->text);                              //nahradi \n za <br />
	}

	function _undo_slashes ()
	{
		get_magic_quotes_gpc() ? stripSlashes($this->text) : $this->text;
	}

	function process ($text, $create_links = false)
	{
		$this->text = $text;
		$this->create_links = $create_links;

		$this->_undo_slashes();
		if($this->html_status) $this->_wiev_format();
		if($this->filter_status) $this->_filter();
		if($create_links) $this->_create_links();

		return $this->text;
	}
}

